import styles from './style.module.css'

interface ProductProps{
  products:
  {
    productName:string;
     productImage:string;
     productPrice:number;
    }[];
}





export default function MenuItem({products}:ProductProps){

    const className = styles.menuItem

    return(
        <>
        { products.map(Item=>(
        <div className={className}>

          <div>{Item.productName}</div>

      <span>{Item.productName}</span>
      <span>{`${Item.productPrice}원`}</span>
      </div>
       ))}
        </>
    );
}
